import styled from "styled-components"
export const Container=styled.div`
    max-width: 768px;
    margin: 0 auto;
`

const FlexBox = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between
`
export const ProfileWrapper= styled(FlexBox)`
    & img{
        color: #A1927F;
    }
`
